/*Table structure for table `bill` */

DROP TABLE IF EXISTS `bill`;

CREATE TABLE `bill` (
  `orderId` varchar(20) NOT NULL COMMENT '订单id,时间戳+玩家id',
  `pid` int(11) NOT NULL COMMENT '商品id',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '购买时间',
  `status` int(11) NOT NULL COMMENT '状态，如已付款、待付款等',
  `pNumber` int(11) NOT NULL COMMENT '商品数量',
  `totlePrice` double NOT NULL COMMENT '订单总价',
  `userId` int(11) NOT NULL COMMENT '玩家id',
  PRIMARY KEY (`orderId`),
  KEY `userId` (`pid`),
  KEY `bill_ibfk_1` (`userId`),
  CONSTRAINT `bill_ibfk_1` FOREIGN KEY (`userId`) REFERENCES `users` (`userid`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

