DROP TABLE IF EXISTS `rechargerecord`;

CREATE TABLE `rechargerecord` (
  `rechargeId` varchar(11) NOT NULL COMMENT '订单id,时间戳+玩家id',
  `userId` int(11) NOT NULL COMMENT '玩家id',
  `pid` int(11) NOT NULL COMMENT '物品id',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '充值时间',
  `status` int(11) NOT NULL COMMENT '状态，如已付款、待付款等',
  `pNumber` int(11) NOT NULL COMMENT '充值数量',
  `totlePrice` double NOT NULL COMMENT '订单总价',
  PRIMARY KEY (`rechargeId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `rechargerecord` */

