  CONSTRAINT `rewardrecord_ibfk_2` FOREIGN KEY (`rewardId`) REFERENCES `reward` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

