/* Procedure structure for procedure `getItemFromMailBox` */

/*!50003 DROP PROCEDURE IF EXISTS  `getItemFromMailBox` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getItemFromMailBox`(in mailId int)
begin
declare mail_id INT DEFAULT 0;
DECLARE item_id INT DEFAULT 0;
DECLARE item_num INT DEFAULT 0;
DECLARE user_id INT DEFAULT 0;
DECLARE t_error INT DEFAULT 0;
DECLARE is_read bit;
DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;
start transaction;
select id,itemId,itemNum,isRead,userId into mail_id,item_id,item_num,is_read,user_id FROM mailbox WHERE id=mailId;
if !is_read then
if item_id=1 then 
update player set power = power + item_num where userId=user_id;
elseif item_id=2 then
UPDATE player SET gold = gold + item_num WHERE userId=user_id;
END IF;
delete from mailbox where id=mailId;
if(t_error=1) then
rollback;
else
commit;
end if;
end if;
end */$$
DELIMITER ;

/* Procedure structure for procedure `queryForDayRank` */

/*!50003 DROP PROCEDURE IF EXISTS  `queryForDayRank` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `queryForDayRank`(IN startDay timestamp,in endDay timestamp,IN citys INT)
BEGIN
declare num int default 0;
select count(*) into num from music where city = citys group by city;
SELECT sumscore/num  as score,userId FROM 
              (SELECT SUM(mg) AS sumscore,userId FROM 
                       (SELECT MAX(mus.normalHighScore) AS mg ,mus.userId,mus.musicId FROM music m LEFT JOIN musicscore mus ON m.musicId = mus.musicId  WHERE m.city = citys AND mus.day BETWEEN startDay AND endDay GROUP BY userId,musicId)
                        AS ms GROUP BY userId) AS r order by sumscore desc;
END */$$
DELIMITER ;

/* Procedure structure for procedure `queryForMemberList` */

/*!50003 DROP PROCEDURE IF EXISTS  `queryForMemberList` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `queryForMemberList`(IN userId_in INT,IN societyId_in INT)
BEGIN
IF userId_in > 0 THEN 
SELECT s.societyId,s.name,s.integration,s.notice,p.userId,p.level,p.job,p.contribution FROM
		player p
		LEFT JOIN societys s ON s.societyId=p.societyId
		WHERE p.societyId=(SELECT
		societyId FROM player WHERE userId=userId_in) order BY p.job ASC,p.contribution desc;
ELSeif societyId_in >0 then
SELECT s.societyId,s.name,s.integration,s.notice,p.userId,p.level,p.job,p.contribution FROM
		player p
		LEFT JOIN societys s ON s.societyId=p.societyId
		WHERE p.societyId=societyId_in order by p.job desc,p.contribution DESC;
END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `queryForSeasonAllRank` */

/*!50003 DROP PROCEDURE IF EXISTS  `queryForSeasonAllRank` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `queryForSeasonAllRank`(IN seasons INT)
BEGIN
DECLARE num INT DEFAULT 0;
SELECT COUNT(*) INTO num FROM music;
SELECT sumscore/num as score,userId FROM 
              (SELECT SUM(mg) AS sumscore,userId FROM 
                       (SELECT MAX(mus.normalHighScore) AS mg ,mus.userId,mus.musicId FROM musicscore mus left join music m on m.musicId = mus.musicId WHERE mus.season = seasons GROUP BY musicId,userId) AS ms GROUP BY userId) AS r ORDER BY score DESC;
END */$$
DELIMITER ;

/* Procedure structure for procedure `queryForSeasonRank` */

/*!50003 DROP PROCEDURE IF EXISTS  `queryForSeasonRank` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `queryForSeasonRank`(IN seasons INT,IN citys INT)
BEGIN
DECLARE num INT DEFAULT 0;
SELECT COUNT(*) INTO num FROM music WHERE city = citys GROUP BY city;
SELECT sumscore/num as score,userId FROM 
              (SELECT SUM(mg) AS sumscore,userId FROM 
                       (SELECT MAX(mus.normalHighScore) AS mg ,mus.userId,mus.musicId FROM musicscore mus left join music m on m.musicId = mus.musicId WHERE mus.season = seasons AND m.city = citys GROUP BY musicId,userId) AS ms GROUP BY userId) AS r ORDER BY score DESC;
END */$$
DELIMITER ;

/* Procedure structure for procedure `queryForWeekRank` */

/*!50003 DROP PROCEDURE IF EXISTS  `queryForWeekRank` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `queryForWeekRank`(IN weeks INT,IN citys INT)
BEGIN
DECLARE num INT DEFAULT 0;
SELECT COUNT(*) INTO num FROM music WHERE city = citys GROUP BY city;
SELECT sumscore/num as score,userId FROM 
              (SELECT SUM(mg) AS sumscore,userId FROM 
                       (SELECT MAX(mus.normalHighScore) AS mg ,mus.userId,mus.musicId FROM musicscore mus LEFT JOIN music m ON m.musicId = mus.musicId  WHERE m.city = citys and mus.week = weeks GROUP BY musicId,userId)
                        AS ms group by userId) AS r order by sumscore desc;
END */$$
DELIMITER ;

